import React, { Component } from 'react';

import './css/footer.css';

class Footer extends Component {

    render() {
        return (
            <>
                <footer id="footer">
                    <p>&copy; 2020 by Gefy Aqiilah Aqshal</p>
                </footer>
            </>

        )
    }
}

export default Footer;
